import navbarStyles from "./Navbar.jsx";

function Navbar() {
  const navRef = useRef();

  const showNavbar = () => {
    navRef.current.classList.toggle("responsive_nav");
  };

  const { nav, logo, navLink, navBtn, navCloseBtn } = navbarStyles;

  return (
    <header style={nav}>
      <h3 style={logo}>
        <img src={Logo} alt="Logo" />
      </h3>
      <nav ref={navRef}>
        <a href="/" style={navLink}>
          Home
        </a>
        <a href="/tickets" style={navLink}>
          Tickets
        </a>
        <a href="/abertura-de-chamados" style={navLink}>
          Abertura de Chamados
        </a>
        <button
          className="nav-btn nav-close-btn"
          onClick={showNavbar}
          style={navCloseBtn}
        >
          <FaTimes />
        </button>
      </nav>
      <button className="nav-btn" onClick={showNavbar} style={navBtn}>
        <FaBars />
      </button>
    </header>
  );
}

export default Navbar;
